fields.Note:
དར་ལྕོག་བཙུགས་ས་ལ་དར་ལྕོག་འཛུགས་ཀར་འགྲོ་མཁན་མང་པོ་ཡོད་རེད།<br>Many people go to put up long
  prayer flags in the area for hanging long prayer flags.&nbsp; 

<br><br>ཚེས་བཟང་དུས་བཟང་ལ་དར་ལྕོག་བཙུགས་ཀྱི་ཡོད་རེད།<br>Prayer flags are hung on the auspicious days.&nbsp;

fields.Morphemes:
བསམ་པ་དང་མོས་པ་མི་འདྲ་བ། = various, different, manifold motivations and dispositions, interests, beliefs (བསམ་པ་ = thought, as in: བསམ་བློ་གཏོང་བ་ = to think, to reflect;
མོས་ = dedication, as in: རེ་མོས་བྱས་ནས་ = alternately;
མི་འདྲ་བ་ = different, མི་ = དགག་སྒྲ་ = negation particle,
འདྲ་བ་ = to be similar, to be like, as in: སྐུ་འདྲ་ = statue)
